  false,\n\t\"url\": null,\n\t\"notes\": \"LiDAR data is a remotely sensed high resolution
  elevation data collected by an airborne platform. The LiDAR sensor uses a combination
  of laser range finding, GPS positioning, and inertial measurement technologies.
  The LiDAR systems collect data point clouds that are used to produce highly detailed
  Digital Elevation Models (DEMs) of the earth's terrain, man-made structures and
  vegetation. The task required the LiDAR data to be collected at a nominal pulse
  spacing (NPS) of 1.0 meter. The final products include first, last, and at least
  one intermediate return LAS, full classified LAS and one (1) meter pixel raster
  DEMs of the bare-earth surface in ERDAS IMG Format. The LiDAR data was acquired
  from February 07, 2012 to March 05, 2012.\",\n\t\"license_title\": null,\n\t\"extras\":
